import React from "react";
import styles from "./studyCard.module.css";

const StudyCardOnline = (props) => {
  const { studyData } = props;
  return (
    <div className={styles.studyCard}>
      <div className={styles.detail}>
        <div>
          <p className={styles.name}>{studyData.name}</p>
          <p className={styles.type}>{studyData.type}</p>
        </div>
        <p className={styles.summary}>{studyData.summary}</p>
        <div>
          첫 스터디<p className={styles.startDay}>{studyData.startDay}</p>
          <p className={styles.env}>
            {studyData.current}/{studyData.max}
          </p>
        </div>
      </div>
    </div>
  );
};

export default StudyCardOnline;
